package image

import (
	"fmt"
	"testing"

	"github.com/disintegration/imaging"
)

//把500k的图像压缩到50k
const src = "data:image/png;base64,"

func TestCompress(t *testing.T) {
	img, err := ConvertToImage(src)
	if err != nil {
		fmt.Printf("fail to convert base64 to image:%s\n", err)
		return
	}
	after, err := Compress(img, 200, imaging.JPEG)
	if err != nil {
		fmt.Printf("fail to compress:%s\n", err)
		return
	}
	data := ConvertToBase64(after)
	fmt.Println(data)
}
